import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { RecipePagePageRoutingModule } from './recipe-page-routing.module';

import { RecipePagePage } from './recipe-page.page';
import { Component } from '@angular/core';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    RecipePagePageRoutingModule
  ],
  declarations: [RecipePagePage]
})
export class RecipePagePageModule {}



@Component({
  selector: 'app-example',
  templateUrl: 'recipe-page.page.html',
})
export class ExampleComponent {
  public alertButtons = ['OK'];
  public alertInputs = [
    {
      placeholder: 'Name',
    },
    {
      placeholder: 'Nickname (max 8 characters)',
      attributes: {
        maxlength: 8,
      },
    },
    {
      type: 'number',
      placeholder: 'Age',
      min: 1,
      max: 100,
    },
    {
      type: 'textarea',
      placeholder: 'A little about yourself',
    },
  ];
}
